const tagName = document.querySelector('.Tag__text_ur20Qx');

const data = {
    income: {
        button: incomeButton,
        color: "rgb(238, 128, 93)",
        title: "Поступления",
        tagList: "Основные",
        tagName: "Перевод с карты",
        value: "<?=$deposits?>"
