};

function switchActiveButton(activeBtn, inactiveBtn) {
    activeBtn.setAttribute('aria-selected', 'true');
    activeBtn.classList.add('TabItem--module__root_active_fSvnQz');
    inactiveBtn.setAttribute('aria-selected', 'false');
    inactiveBtn.classList.remove('TabItem--module__root_active_fSvnQz');
}

function updateStylesAndValues(dataObj) {
    piePart.style.stroke = dataObj.color;
    piePartSector.style.fill = dataObj.color;
    tagIcon.style.backgroundColor = dataObj.color;
    pieChartTitle.innerText = dataObj.title;
    tagListWithTitle.innerText = dataObj.tagList;
    tagName.innerText = dataObj.tagName;
    const valueHTML = `${dataObj.value}<span class='Money--module__smalls_dgICnB' data-qa-file='Money'>&nbsp;₽</span>`;
    pieChartValue.innerHTML = valueHTML;
    tagValue.innerHTML = valueHTML;
}

incomeButton.addEventListener('click', function() {
    switchActiveButton(incomeButton, expensesButton);
    updateStylesAndValues(data.income);
});

expensesButton.addEventListener('click', function() {
    switchActiveButton(expensesButton, incomeButton);
    updateStylesAndValues(data.expenses);
});

